import { Component } from '@angular/core';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
})
export class HomeComponent {
}
<h3>Applicant: Christian Ian Cuya</h3>
<br>
<p>Commands that i used during the development:</p>
<ul>
  <li><strong>npm start</strong>. For running the angular application</li>
  <li><strong>ng g component </strong>. For creating a new component.</li>
  <li><strong>ng g service</strong>. For generating a new service</li>
  <li><strong>ng g class test --type="model"</strong>. For generating a new model</li>
</ul>
